async function cached_glb_layer_waitForGLTFAssets(gltfObjects) {
    return new Promise(async (resolve, reject) => {
        const remaining = [];

        gltfObjects.scenes.forEach(scene => {
            scene.traverse((model) => {
            Object.values(model.model.getUniforms()).forEach((uniform) => {
                if (uniform.loaded === false) {
                remaining.push(uniform);
                }
            });
            });
        });

        await cached_glb_layer_waitWhileCondition(() => remaining.some(uniform => !uniform.loaded));
        resolve();
    });
}

async function cached_glb_layer_waitWhileCondition(condition) {
  while (condition()) {
    await new Promise(resolve => requestAnimationFrame(resolve));
  }
}

